import Link from "next/link";

const Menu = () => {
  return (
    <ul className="menu">
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/services">
          <a>Services</a>
        </Link>
      </li>
      <li>
        <Link href="/portfolio">
          <a>Portfolio</a>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <a>about</a>
        </Link>
      </li>
      <style jsx global>
        {`
          .menu {
            display: flex;
            // margin: 5px 0 0;
            padding: 0;
            list-style: none;
          }
        `}
      </style>
    </ul>
  );
};

export default Menu;
